import React, { Component } from 'react';
import {NavLink} from 'react-router-dom';


class Nav extends Component{
    render(){
        return(
            <header>
                <nav className="navigation-container">
                    <NavLink exact to="/"className="navigation-container-item">Home</NavLink>
                    <NavLink to="/about"className="navigation-container-item">About us</NavLink>
                    <NavLink to="/contact"className="navigation-container-item">Contact</NavLink>
                    <NavLink to="/portfolio"className="navigation-container-item">Portfolio</NavLink>
                </nav>
            </header>
        );
    }
}

export default Nav;
